import{_get as e}from"../_modules/get/get.min.js";async function getScoutRanks(){let t=document.getElementById("viewScoutsButton");t.innerText="Requesting Data...",e("/api/scouts",t.id).then(e=>{for(var n="",o=0;o<e.length;o++)"true"==e[o].accessOk&&(n+=`<tr><td><a href="/browse?userId=${e[o].id}" style="all: unset; color: #2997FF; text-decoration: none;">${e[o].username} (${e[o].team})</a></td><td>${Math.round(e[o].score)}</td></tr>`);document.getElementById("preInsert").insertAdjacentHTML("afterend",n),document.getElementById("eventCodeDisplay").innerText="Top scouts",t.innerText="Reload Data"}).catch(e=>console.log(e))}document.body.onload=getScoutRanks;